  - uid: azure-arm-batchai.Jobs.beginCreate
    name: beginCreate
    children: []
    type: method
    langs:
      - typeScript
    summary: Creates a Job in the given Experiment.
    syntax:
      content: >-
        function beginCreate(resourceGroupName: string, workspaceName: string,
        experimentName: string, jobName: string, parameters:
        JobCreateParameters, options?: Object)
      parameters:
        - id: resourceGroupName
          type:
            - string
          description: |
            Name of the resource group to which the
            resource belongs.
        - id: workspaceName
          type:
            - string
          description: >
            The name of the workspace. Workspace names can

            only contain a combination of alphanumeric characters along with
            dash (-)

            and underscore (_). The name must be from 1 through 64 characters
            long.
        - id: experimentName
          type:
            - string
          description: >
            The name of the experiment. Experiment names

            can only contain a combination of alphanumeric characters along with
            dash

            (-) and underscore (_). The name must be from 1 through 64
            characters long.
        - id: jobName
          type:
            - string
          description: >
            The name of the job within the specified resource

            group. Job names can only contain a combination of alphanumeric
            characters

            along with dash (-) and underscore (_). The name must be from 1
            through 64

            characters long.
        - id: parameters
          type:
            - azure-arm-batchai.JobCreateParameters
          description: |
            The parameters to provide for job creation.
        - id: options
          type:
            - Object
          description: ''
          optional: true
      return:
        type:
          - Promise<azure-arm-batchai.Job>
    package: azure-arm-batchai
